import React from 'react'
import './quoteForm.css'

const QuoteForm = () => {
  return (
    <div className="quote-form">
        <div className="quote-form-heading-container">
        <div className="quote-form-heading">
            Get a Quote, and go Online!
        </div></div>
    </div>
  )
}

export default QuoteForm
